class SubPage3_1 extends StatelessWidget {
  final String nome = 'Enzo';
  final String dia = 'Quarta-Feira';

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        leading: const Icon(Icons.home),
        title: const Text('Página Inicial'),
      ),
      body: Center(
        child: RichText(
          textDirection: TextDirection.ltr,
          textAlign: TextAlign.center,
          text: TextSpan(
            text: 'Bom dia, ',
            style: TextStyle(fontSize: 30, color: Colors.black),
            children: <TextSpan>[
              TextSpan(
                text: '$nome',
                style: TextStyle(
                    fontWeight: FontWeight.bold,
                    color: Color.fromARGB(255, 255, 255, 255),
                    backgroundColor: Color.fromARGB(255, 0, 0, 0)),
              ),
              TextSpan(text: '!\nHoje é '),
              TextSpan(
                text: dia,
                style: TextStyle(
                    fontStyle: FontStyle.italic,
                    color: Color.fromARGB(255, 51, 255, 0)),
              ),
              TextSpan(text: '!\n'),
              TextSpan(
                text: 'Pelo visto a pratica era +/- isso neh!',
                style: TextStyle(
                    fontStyle: FontStyle.italic,
                    color: Color.fromARGB(255, 255, 0, 0),
                    backgroundColor: Color.fromARGB(255, 255, 230, 0)),
              ),
            ],
          ),
        ),
      ),
      floatingActionButton: FloatingActionButton(
        onPressed: () => Navigator.pop(context),
        tooltip: 'Voltar',
        child: Icon(Icons.arrow_back),
      ),
    );
  }
}

